import React, { useContext, useState, useEffect } from 'react'

import axios from 'axios'

import { Formik, Field, Form } from 'formik'
import { useFormik } from 'formik'

import { InputLabel, MenuItem, FormControl, FormLabel, Select } from '@mui/material/';

import { GlobalVariablesContext } from '../../Context/GlobalVariablesContext'

/* import residenceTypes from '../../Json/ResidenceTypes'
import livingPlaceTypes from '../../Json/LivingPlaceTypes' */


const SomeQuestions = (props) => {

    const { REACT_APP_URL } = useContext(GlobalVariablesContext)

    const formik = useFormik({
      initialValues: {
        email: 'foobar@example.com',
        password: 'foobar',
      },
      validationSchema: validationSchema,
      onSubmit: (values) => {
        alert(JSON.stringify(values, null, 2));
      },
    });

    const[complexNames, setComplexNames] = useState([])

    const fetchComplexNames = () => {
        axios.get(REACT_APP_URL + 'vhe/complexname').then(result => {
            const response = result.data.results
            console.log(response)
            setComplexNames(response)
        }).catch(e => {
            console.log('Error getting data: ' + e)
        })
    }

    useEffect(() => {
        fetchComplexNames()
    }, [])

    if(!setComplexNames) return null

    return (
        <>
            <div className='form__container'>

                <h5>Questions about the residence</h5>

                <Formik
                    initialValues={{
                        part_of_complex: '',
                        is_existing_complex: '',
                        introduction: {
                            existing_complex_name: '',
                            residence_type: '',
                            vhe_type: ''
                        }
                    }}
                    onSubmit={( data ) => {
                        console.log(data)
                        const res = axios.post(REACT_APP_URL + 'vhe/registerintroduction/', data)
                        res.then(res => { console.log('res', res) }).catch( error => { console.log(error) })
                        props.next(data)
                    }}
                >
                {({
                    values,
                    handleChange,
                    handleBlur
                }) => (
                    <Form>
                        <div>Part of a complex</div>
                        <div>
                            <label>
                                <Field type='radio' name='part_of_complex' value='true' />
                                Yes
                            </label>
                            <label>
                                <Field type='radio' name='part_of_complex' value='false' />
                                No
                            </label>
                        </div>

                        {values.part_of_complex && (
                            <>
                                <div>Existing complex</div>
                                <div>
                                    <label>
                                        <Field type='radio' name='is_existing_complex' value='true' />
                                        Yes
                                    </label>
                                    <label>
                                        <Field type='radio' name='is_existing_complex' value='false' />
                                        No
                                    </label>
                                </div>
                            </>
                        )}

                        {values.part_of_complex && values.is_existing_complex && (
                            <FormControl>
                                <div id='existingComplexName__div'>
                                    <FormLabel component='legend' style={{ color: 'black', marginBottom: '10px'}}>Choose a complex</FormLabel>
                                    <div id='existingComplexNameError__div'>
                                        <Select
                                            name='introduction.existing_complex_name'
                                            defaultValue='introduction.existing_complex_name'
                                        >
                                            <MenuItem value=''>Choose complex name</MenuItem>
                                            {complexNames.map((item, index) => (
                                                <MenuItem key={index} value={item.id}>{item.complex_name}</MenuItem>
                                            ))}
                                        </Select>
                                    </div>
                                    <div id='existingComplexNameError__container'>
                                        {/* {errors.existing_complex_name && errors.existing_complex_name.type === 'required' && <span className='red_COLOR error_FORM'>A complex name is required</span>} */}
                                    </div>
                                </div>
                            </FormControl>
                        )}
                        <>
                            <label htmlFor='introduction.existing_complex_name' style={{ display: 'block' }}>
                                Complex name
                            </label>
                            <select
                                name='introduction.existing_complex_name'
                                value={values.introduction.existing_complex_name}
                                onChange={handleChange}
                                onBlur={handleBlur}
                                style={{ display: 'block' }}
                            >
                                <option value='' label='Select a complex' />
                                {allData.map((item, index) => (
                                    <option key={index} value={item.id} label={item.complex_name} />
                                ))}
                            </select>
                        </>

                       {/*  <label htmlFor='introduction.residence_type' style={{ display: 'block' }}>
                            Complex name
                        </label>
                        <select
                            name='introduction.residence_type'
                            value={values.introduction.residence_type}
                            onChange={handleChange}
                            onBlur={handleBlur}
                            style={{ display: 'block' }}
                        >
                            <option value='' label='Select a residence type' />
                            {ResidenceTypes.map((item, index) => (
                                <option key={index} value={item.value} label={item.label} />
                            ))}
                        </select>

                        <label htmlFor='introduction.vhe_type' style={{ display: 'block' }}>
                            Complex name
                        </label>
                        <select
                            name='introduction.vhe_type'
                            value={values.introduction.vhe_type}
                            onChange={handleChange}
                            onBlur={handleBlur}
                            style={{ display: 'block' }}
                        >
                            <option value='' label='Select a living place type' />
                            {LivingPlaceTypes.map((item, index) => (
                                <option key={index} value={item.value} label={item.label} />
                            ))}
                        </select> */}

                        <button type='submit'>Submit</button>
                    </Form>
                )}
                </Formik>
            </div>
        </>
    )
}

export default SomeQuestions
